  function toggleColor(){
    setContact(prevS=>({...prevS, on:false}))
    console.log("gg")
  }
  let box=contact.map(
    (a)=>(
    <Boxie theId={a.id} isOn={toggleColor} isValue={a.on}/>)
  )
  return (
    <div >
      {box}
    </div>

  )
};
export default App;
